import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import ListAllIssues from './components/ListAllIssues';

function App() {
  return (
    <div>
      <Router>

                <div className="container">
                    <Switch> 
                          <Route path = "/" exact component = {ListAllIssues}></Route>
                          <Route path = "/issues/allissue" component = {ListAllIssues}></Route>

                    </Switch>
                </div>

        </Router>

    </div>
  );
}

export default App;
